input:focus-visible {
    outline: none;
}

textarea:focus-visible {
    outline: #6C79CB auto 1px;
}

div[kw="Calendar"]>img {
    padding: 2.5% !important;
}

.btnSkipNavigation {
    transform: translateY(-1000px);
}

.btnSkipNavigation:focus-visible {
    transform: translateY(0px);
}

.btnMenu,
.btnMenu-focus {
    background-size: 25px 25px !important;
    background-position: center !important;
}

.txtAreaResize {
    resize: both !important;
    border: 1px solid;
    max-width: 90%;
}

div[kw="FlexContainer"]:focus-visible {
    outline: #6C79CB auto 1px;
    outline-offset: -2px;
}

img:focus-visible {
    outline: #6C79CB auto 1px;
    outline-offset: 4px;
}

button[kw="Button"]:focus-visible {
    outline: #6C79CB auto 1px;
    outline-offset: 3px;
}

input[kw="TextBox2"]:focus-visible {
    outline: #6C79CB auto 1px;
    outline-offset: 0px;
}

label:focus-visible {
    outline: none;
}

div[kw="RichText"]:focus-visible {
    outline: none;
}

.defRichTextNormal-linkfocus>a {
    cursor: pointer !important;
}

select[kw="ListBox"]:focus-visible {
    outline: #6C79CB auto 1px;
    outline-offset: 0px;
}

::-ms-reveal {
    display: none;
}

.slLabel0d8a72616b3cc47:focus-visible {
