.customTradeChartLegend ul {
  width: 100%;
  display: grid;
  grid-auto-flow: row;
  grid-template-columns: repeat(2, 1fr);
  grid-row-gap: 12px;
  grid-column-gap: 16px;
}
.customTradeChartLegend ul li {
  display: flex;
  align-items: center;
  font: normal 400 13px SourceSansPro-Regular;
  color: #000;
}
.customTradeChartLegend ul li span {
  height: 12px;
  width: 12px;
  margin-right: 5px;
  border-radius: 50%;
}
.customTradeChartLegend ul li p {
  width: 80%;
}
